import React from 'react'

const Counter = () => {
  return (
    <div className='container mx-auto grid grid-cols-4'>
      <div>
        <img src='./images/travel.png'></img>
        <h3>280</h3>
        <h4>Successful Tours</h4>
      </div>
    </div>
  )
}

export default Counter
